import React from "react";
import TeamMember from "./TeamMember";

function Team() {
  return (
    <div className="row">
      <TeamMember
        info={{
          img: "https://i.pinimg.com/originals/ff/dc/33/ffdc335976c6b3366fbbb453da589afe.jpg",
          name: "Robert Downey Jr.",
          age: "57",
          phone: "(555) 555-1234",
          rolle: "Iron Man",
          nameInMovie: "Tony Stark",
        }}
      />
      <TeamMember
        info={{
          img: "https://i.pinimg.com/originals/fb/39/19/fb3919a9015584a91fe257c7ee6bc37a.jpg",
          name: "Chris Evans",
          age: "41",
          phone: "(555) 555-1234",
          rolle: "Captain America",
          nameInMovie: "Steve Rogers",
        }}
      />

      <TeamMember
        info={{
          img: "https://i.pinimg.com/originals/27/8c/28/278c2888be299c38ca341da51beadd27.jpg",
          name: "Mark Ruffalo",
          age: "55",
          phone: "(555) 555-1234",
          rolle: "Hulk",
          nameInMovie: "Bruce Banner",
        }}
      />
      <TeamMember
        info={{
          img: "https://i.pinimg.com/originals/71/55/4f/71554f8d07feb30136924aa8fd5e1f35.jpg",
