          age: "41",
          phone: "(555) 555-1234",
          rolle: "Thor",
          nameInMovie: "Thor",
        }}
      />
      <TeamMember
        info={{
          img: "https://los40es00.epimg.net/los40/imagenes/2018/01/25/cinetv/1516896997_177677_1516897112_noticia_normal.jpg",
          name: "Scarlett Johansson",
          age: "37",
          phone: "(555) 555-1234",
          rolle: "Black Widow",
          nameInMovie: "Natasha Romanoff",
        }}
      />
      <TeamMember
        info={{
          img: "https://i.pinimg.com/originals/05/a7/3a/05a73a4f35d942a6710654e0251a6370.jpg",
          name: "Jeremy Renner",
          age: "51",
          phone: "(555) 555-1234",
          rolle: "Hawkeye",
          nameInMovie: "Clint Barton",
        }}
      />
      <TeamMember
        info={{
          img: "https://m.media-amazon.com/images/I/41Dn2wQedUL._AC_.jpg",
          name: "Tom Hiddleston",
          age: "41",
          phone: "(555) 555-1234",
          rolle: "Loki",
          nameInMovie: "Loki",
