      />
      <TeamMember
        info={{
          img: "https://pyxis.nymag.com/v1/imgs/c9e/349/c6dab6c01428485c3f89e0a377a24a7af6-26-clark-gregg-shield.rsquare.w700.jpg",
          name: "Clark Gregg",
          age: "60",
          phone: "(555) 555-1234",
          rolle: "Agent Phil Coulson",
          nameInMovie: "Agent Phil Coulson",
        }}
      />
      <TeamMember
        info={{
          img: "https://i.pinimg.com/736x/46/ce/3f/46ce3f945076e0f2fbda6ec4d519e7e7.jpg",
          name: "Cobie Smulders",
          age: "40",
          phone: "(555) 555-1234",
          rolle: "Agentin Maria Hill",
          nameInMovie: "Agentin Maria Hill",
        }}
      />

      <TeamMember
        info={{
          img: "https://image.film.at/images/cfs_square_1232/2674211/samuel-l-jackson-as-nick-fury2.jpg",
          name: "Samuel L. Jackson",
          age: "41",
          phone: "(555) 555-1234",
          rolle: "Captain America",
          nameInMovie: "Steve Rogers",
        }}
      />
      <TeamMember
        info={{
          img: "http://t0.gstatic.com/licensed-image?q=tbn:ANd9GcSUyfIh6eheeg9nwr7W5uyBCCC3Tr8rcGFqi1p_SRl2gQbMUSZExnlswpSGYKQUABkk",
          name: "Chris Evans",
          age: "41",
          phone: "(555) 555-1234",
          rolle: "Captain America",
          nameInMovie: "Steve Rogers",
        }}
      />
      <TeamMember
        info={{
          img: "http://t0.gstatic.com/licensed-image?q=tbn:ANd9GcSUyfIh6eheeg9nwr7W5uyBCCC3Tr8rcGFqi1p_SRl2gQbMUSZExnlswpSGYKQUABkk",
          name: "Chris Evans",
          age: "41",
          phone: "(555) 555-1234",
          rolle: "Captain America",
          nameInMovie: "Steve Rogers",
        }}
      />
    </div>
